pragma solidity >=0.8.0 <=0.8.7;

contract A{
    int public x = 10;
    int y = 20; //internal variable, needs getter fn

    function get_y() public view returns(int){
        return y;
    }

    function f1() private view returns(int){
        return x;
    }

    function f2() public view returns(int){
        int a;
        a = f1();
        return a;
    }

    function f3() internal view returns(int){
        return x;
    }

}

contract B is A{
    int public xx = f3();
    //int public yy = f1(); -> f1() is private and cannot be from derived co
}

